import React, { Component } from 'react';
import './index.css';

class App extends Component {
  render() {
    return (
      <div>
        <h1 className='title-style'>ToDo List</h1>
        <form className='flex justify-center items-center w-full'>
          <input 
            className='w-5/6'
          />
          <button className='bg-sky-600 w-1/6'>
            Add
          </button>
        </form>
        <div className='flex bg-slate-400 w-full h-screen mt-10'>
          <div className='bg-sky-400 w-1/2'></div>
          <div className='bg-sky-400 w-1/2'></div>
        </div>
      </div>
    )
  }
}

export default App;
